import React from "react";

const CountryImage = () => {
  const options = {
    method: "GET",
    headers: {
      "X-RapidAPI-Key": "3dc1a90a57msh1832834cdf55bdep1ed1b2jsnc624f5031a4f",
      "X-RapidAPI-Host": "google-image-search1.p.rapidapi.com",
    },
  };

  fetch(
    "https://google-image-search1.p.rapidapi.com/v2/?q=Paris&hl=en",
    options
  )
    .then((response) => response.json())
    .then((response) => console.log(response.json))
    .catch((err) => console.error(err));

  return <div></div>;
};

export default CountryImage;
